import pytest

from ticket_service import create_app

@pytest.fixture(scope='module')
def client():
    flask_app = create_app()

    # Create a test client using the Flask application configured for testing
    with flask_app.test_client() as testing_client:
        # Establish an application context
        with flask_app.app_context():
            yield testing_client  # this is where the testing happens!

def test_post_empty_message(client):
    response = client.post('/api/tickets')
    assert response.status_code == 400

def test_successful_post(client):
    json = {
        "event_name": "Night of the Proms 2021",
        "event_timestamp": "23/09/2021 19:00:00",
        "event_place": "Sportpaleis",
        "seat": "2A",
        "owner": "Richard Van Drogenbroeck"
    }

    response = client.post('/api/tickets', json=json)
    assert response.status_code == 201
    assert response.json['id'] is not None
    assert response.json['qr_code'] is not None

def test_ticket_validate(client):
    json = {
        "qr_code": ""
    }

    response = client.put('/api/tickets/validate', json=json)
    assert response.status_code == 200
    assert response.data is not None
